function getDateDifference(e){const t=new Date(11481696e5);let n=e-t,a=Math.floor(n/864e5),i=0,o=0;for(;a>=365;){let e=new Date(t.getFullYear()+o+1,0,0).getTime()-new Date(t.getFullYear()+o,0,0).getTime(),n=Math.floor(e/864e5);if(!(a>=n))break;o++,a-=n}for(;a>=30;){let e=new Date(t.getFullYear()+o,t.getMonth()+i+1,0).getDate();if(!(a>=e))break;i++,a-=e}return{days:a,months:i,years:o}}const date=new Date,difference=getDateDifference(date),dateString=date.toUTCString(),timeSinceBirthdayString=document.getElementsByClassName("time-since-birthday"),currentDateString=document.getElementById("current-date");currentDateString.innerHTML=dateString;for(let e=0;e<timeSinceBirthdayString.length;e++)timeSinceBirthdayString[e].innerHTML=`${difference.years}.${difference.months}.${difference.days}`;window.onload=async()=>{document.getElementsByTagName("body")[0].style.opacity=1,console.log("Finished loading."),document.onkeypress=e=>{console.log("Skipping animation since key was pressed!!"),window.location.href="/home"},await sleep(2250),console.log("Commencing animations!"),await playShellAnimation(),await sleep(400),await playTypingAnimation()};